package JavaTraining;

public class ifElseLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i = 40;
		
		if(i<20)
		{
			System.out.println("i value less than 20");
		}
		else if(i<30)
		{
			System.out.println("i value less than 30");
		}
		else
		{
			System.out.println("i value greater than 30");
		}

	}

}
